INSERT INTO `privacy_policy` (`id`, `policy`, `created_at`, `updated_at`) VALUES
(1, '<div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">PRIVACY POLICY</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">A.This Privacy Policy (“Privacy Policy”) applies to the Company vedang web private limited (here in referred to as “Company/Goodwish9”) digital Websites/Applications platforms including without limitation www.vedangweb.com and other related Websites/Applications, mobile applications, and other online features (herein referred to as “Websites/Applications”). The Websites/Applications are offered by the Company/ Goodwish9 and its subsidiaries or affiliated companies. (collectively, “The Company/Goodwish9” or “we”, “us” and “our”).</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">B.This Privacy Policy should be read in conjunction with the Terms of Use available on the Websites/ Applications. Personal Information/Data/Information (defined below) of a user(s) is collected if the user(s) registers with the Websites/Applications, accesses the Websites/Applications, or takes any action on the Websites/Applications or uses or accesses the Services as defined in the Terms of Use. The terms \'Personal Information and \'Sensitive Personal Information or Information shall have the meaning ascribed to them under the Indian Information Technology Act, 2000 read with the Information Technology.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">C.Please read this Privacy Policy carefully as your use of these Websites/Applications constitutes your consent to the processing of your Personal Information as described in the Privacy Policy. If you are younger than 18 years of age, and you wish to provide us with your Personal Information to participate in a promotion or contest, you must read this Privacy Policy with your parent or guardian.</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">SUMMARY OF KEY POINTS</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">1. We use Personal Information to allow you to participate in the features on the Websites/Applications, process your registration, and provide you with other requested content related to our content and other offerings.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">2. We provide interactive features that engage with third-party social media Websites/Applications, such as Facebook and Twitter. Any data that we obtain about your use of such features is subject to this Privacy Policy. Any data that the social media Websites/Applications gather about you is subject to your terms with them.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">3. We use cookies and other technologies to track the use of our Websites/Applications. We allow third parties to place such technologies on our Websites/Applications to allow them to display advertising and for other purposes.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">4. If you are under 18 years old, you must obtain the permission of your parent or guardian before participating in a contest or engaging in other activities. The only exceptions are if you simply sign up for a newsletter.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">5. We may disclose your Personal Information to any of our employees, officers, insurers, professional advisers, agents, suppliers or subcontractors, etc. insofar as necessary for the purposes set out in this Privacy Policy. We may also disclose Personal Information when you request or agree to such sharing with business partners or other third parties when we engage a third party to process data on our behalf when such sharing is required by law, or in certain other situations.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">6. This Websites/Applications may be hosted on web servers in jurisdictions outside India. Your use of the Websites/Applications constitutes your consent to the transfer of Personal Information to any other jurisdiction that may not provide the same level of data protection as your home country.</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">INFORMATION COVERED BY THIS PRIVACY POLICY</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">i. The Company may collect Personal Information/Information, including your name, email or street address, date of birth, telephone number, preferences, and interests, or other information you provide to us or grant us access to when you register for newsletters, communicate with us, or take part in interactive competitions. The Websites/Applications may also ask you to provide other information about yourself, such as demographic, geographic information (gender, zip code, age, etc.), or certain information about your preferences and interests. If we combine demographic or other information we collect about you with Personal Information about you, we will treat the combined information as personal information. Please note that information submitted to the Websites/Applications via a “contact us” or other similar function may not receive a response. The Company will not use the information provided to contact you for marketing purposes unrelated to your request unless you agree otherwise.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">ii. Whenever you visit or interact with the Websites/Applications or the Company/Goodwish9 content, The Company/Goodwish9, any third-party advertisers, content providers, and/or service providers, may use a variety of technologies that automatically or passively collect information, etc. about how the Websites/Applications are accessed and used (“Usage Information”). Usage Information may include, in part, browser type, operating system, the page served, the time, and the preceding page &amp; video views, etc. Usage Information is generally non-identifying, but if The Company/ Goodwish9 associates it with you as a specific and identifiable person, The Company/ Goodwish9 treats it as Personal Information. The Company/ Goodwish9 also automatically collects your IP address or another unique identifier (“Device Identifier”) from the computer, mobile device, technology, or another device (collectively, “Device”) you use to access the Websites/Applications. A Device Identifier is a number that is automatically assigned to your Device when you access a Websites/Applications or its servers, and our computers identify your Device by its Device Identifier. Some mobile service providers or our third-party service provider may also provide us with information regarding the physical location of the Device used to access the Websites/Applications.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iii. The technologies used on the Websites/Applications to collect Usage Information, including Device Identifiers, have been detailed herein below.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iv. You must create an account on the portal of our Company with the applicable Producer. By creating an account, you agree to provide certain personal information to the Producer and the Company. When the Company collects, stores, and processes that information, it does so solely on behalf of the applicable Producer and at its direction to, among other things, allow the Producer to provide you with the applicable Producer Channel. In general, the Company serves as a “processor” to the Producer and the Producer is the “controller” of your information.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">v. The Company possesses the appropriate security measures to protect against the loss, misuse, and unauthorized alteration of the information under the Company’s control. However, the Company is not responsible for any kind of disruptions or occurrence of unauthorized access.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">vi. You are solely accountable for (a) keeping your account(s) secure and (b) for all activity that takes place under your account (s). If you suspect any unauthorized access to or use of your account, you must contact us right away (s). If you\'ve forgotten your account login details, you can ask us to send them to the email address linked to your account (s).</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">COOKIES AND OTHER TRACKING TECHNOLOGIES</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">i. By using the Websites/Applications, you consent to the use of cookies in accordance with the provisions of this clause. A cookie is a data file placed on a Device when it is used to visit Websites/Applications. A “Flash Cookie” is a data file placed on a Device via the Adobe Flash plug-in that may be built into or downloaded by you to your Device. Cookies and Flash Cookies may be used for many purposes, including, without limitation, remembering you and your preferences and tracking your visits to our web pages. If you choose to disable cookies or Flash Cookies on your Device, some features of the Websites/Applications may not function properly. The use of cookies on the Websites/Applications allows you to enjoy more seamless visits and more accurately measures your behavior on the Websites/Applications. There are two types of cookies that we may use: session and persistent. Session cookies exist only during an online session.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">ii. They disappear from your Device when you close the browser software. Persistent cookies remain on your Device after the browser has been closed. The cookies used on the Websites/Applications do not identify you personally. They merely recognize your browser, unless you choose to identify yourself voluntarily. You may choose to identify yourself for any one of the following reasons: by asking the browser to remember your username and password, by responding to a promotional offer, or by personalizing a web page or requesting more information on a product or service.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iii. Web beacons (also known as clear gifs) are used in combination with cookies to help Websites/Applications operators understand how you interact with their Websites/Applications. A web beacon is typically a transparent graphic image (usually 1 pixel x 1 pixel) that is placed on a Websites/Applications or in an email. The use of a clear gif allows the Websites/Applications to measure your actions in opening the page that contains the clear gif.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iv. Embedded scripts are programming codes that are designed to collect information about your interactions with the Websites/Applications, such as the links you click on. The code is temporarily downloaded onto your Device from our server or a third-party service provider is active only while you are connected to the Websites/Applications, and is deactivated or deleted thereafter.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">v. The Company/ Goodwish9 may use cookies and web beacons for a number of purposes, including to:</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">a. Provide general internal and customer analytics.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">b. Study traffic patterns in order to improve Websites/Applications’ performance, customize the user experience, and better match the users\' interests and preferences. For example, The Company/ Goodwish 9 keeps track of the domains from which people visit, and also measures/tracks visitor activity on The Company/ Goodwish 9 Websites/Applications. However, these tracking records are performed and maintained in ways that keep the data non-identifiable.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">c. Keep track of preferences you specify while you are using The Company/ Goodwish 9 products or services.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">d. Support security measures, such as requiring re-login into a Company/ Goodwish 9 product or service, after a certain amount of time has elapsed.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">e. If you log in to our products through the Websites/Applications, cookies can also be used to save the username so that we can process the saved login information and quickly log you into the product.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">f. Assist in identifying possible fraudulent activities.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">g. Tell if an email has been opened and acted upon</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">vi. Controlling our use of Cookies: The Adobe Flash Player (“Flash”) is an application and web tool that allows rapid development of dynamic content. Flash (and similar applications) use technology to remember settings, preferences, and usage similar to browser cookies, which may be used by The Company/ Goodwish9. The Company/ Goodwish9 employs Adobe Flash cookies in certain situations where we use Flash to provide some content such as video clips or animation. The Company/ Goodwish9 does not use Flash Cookies to serve interest-based advertising. Flash Cookies are managed through the Flash Player Settings Manager, which is a different interface than the one provided by your web browser. This Settings Manager lets you manage global Privacy Settings, Storage Settings, Security Settings, and Automatic Notification Settings. This Websites/Applications may also use Google Analytics, a web analysis service of Google Inc. (“Google”). Google Analytics uses cookies, and text files that are stored on your Device and allow an analysis of your use of the Websites/Applications. If Google Analytics is used, the information generated by the cookie about your use of the Websites/Applications (including the IP address) will be transferred to and stored on a server of Google in the US. Google will use such information to analyze your use of the Websites/Applications, to create reports about the Websites/Applications activities for the Company/ Goodwish9, and to provide further services associated with the use of the Websites/Applications and the internet.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">vii. Furthermore, Google may transfer such information to third parties, to the extent legally required or if such third parties process the data on behalf of Google. In no event will Google associate your IP address with other information of Google. By using these Websites/Applications, you consent to the processing of your information collected by Google as described above and for the purposes described above. Google Analytics can be disabled through this link: http://tools.google.com/dlpage/gaoptout. The Company/ Goodwish9 at its sole discretion may employ any other third party(ies) analytics services, as may be required.</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">LOG FILE INFORMATION</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">i. Our servers automatically collect limited information about your Devices\' connection to the internet, including your IP address, Device and/or MAC ID, etc., when you visit our Websites/Applications. Your IP address is a number that lets computers attached to the internet know where to send your data -- such as the web pages you view. Your IP address, Device and/or MAC ID, etc., does not identify you personally but may be combined with your Personal Information which then may identify you personally.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">ii.The Company hereby informs you that the Company collects the required information from log data that your software or device sends to us during the time you access our services.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iii.This data includes information such as your computer\'s Internet Protocol (“IP”) address, browser version, the pages of the Service that you visit, the time and date of your visit, the time spent on those pages, and other statistics. there is.</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">MINOR\'S PERSONAL INFORMATION</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">i. Certain Websites/Applications may attract individuals younger than 18 years old of age (“Minor” or “Minors”). On those Websites/Applications, The Company/ Goodwish9 may collect the e-mail address and ages of Minors in order to send them newsletters and engage them in other limited activities. If you are a Minor, and you wish to provide us with your Personal Information for any other purposes, such as to participate in a promotion or contest, you must read this Privacy Policy with your parent or guardian and must not provide your Personal Information without obtaining your parent\'s or guardian\'s prior consent and under their supervision.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">ii. If we are notified or otherwise learn that a Minor has submitted Personal Information to us through any of our Websites/Applications other than under the conditions set forth above, we will delete that Minor\'s Personal Information. Children younger than 18 years of age may only surf the Websites/Applications and play with the features, but The Company/ Goodwish9 does not knowingly collect data of users younger than 18 years of age.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iii. The services provided by the Company are not applicable to children under the age of 18. The Company does not on its own collect personally identifiable information from children under the age of 18.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iv. In the case the company encounters that any personal information of the children below the age of 18 is provided to us, we shall on an immediate basis remove such information from our servers</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">HOW WE USE YOUR INFORMATION</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">We will use Personal Information collected through the Websites/Applications to:</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">i. allow you to participate in the features we offer on the Websites/Applications;</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">ii. provide you with information that you request or agree to receive;</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iii. improve the Websites/Applications and for internal business purposes;</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iv. contact you with regards to your use of the Websites/Applications, and any changes to our policies;</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">v. tailor content, advertisements, and offers we serve you, and (6) fulfill other purposes disclosed at the time you provide your Personal Information or otherwise with your consent.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">vi. While using our Service, we may require you to provide us with certain personally identifiable information, such as your name, phone number, and postal address, in order to provide you with a better experience. We may use the information we collect to contact or identify you.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">vii. This information is gathered in accordance with applicable laws and regulations in the operational jurisdictions of our Company.</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">HOW WE SHARE YOUR PERSONAL INFORMATION</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• WHEN YOU AGREE TO HAVE YOUR PERSONAL INFORMATION SHARED</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">While on our Websites/Applications, you may have the opportunity to opt-in to receive information and/or marketing offers from someone else or to otherwise consent to the sharing of your Personal Information with a third party. If you agree to have your Personal Information shared, your Personal Information will be disclosed to the third party and the Personal Information you disclose will be subject to the Privacy Policy and business practices of that third party. You may also specifically request the Company/ Goodwish9, sometimes, through your use of an interactive feature, a widget, or an application, we share your Personal Information with a third party and we will typically do so under those circumstances. In addition, if you choose to register for a promotion, such as a competition, prize draw, or contest, your Personal Information may be disclosed to third parties for the purposes of administration of such promotions.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• FOR SWEEPSTAKES, CONTESTS, AND PROMOTIONS.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">The Websites/Applications may offer sweepstakes, contests, and other promotions (each, a “Promotion”) that may require registration. If you choose to enter a Promotion, your Personal Information may be disclosed to third parties in connection with the administration of such Promotion, such as in connection with winner selection, prize fulfillment, and as required by law, such as on a winners list. By entering a Promotion, you are agreeing to the official rules that govern that Promotion, which may contain specific requirements from you, including, except where prohibited by law, allowing the sponsor and/or other parties to use your name, voice, and/or likeness in advertising or marketing materials.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• ON-SITE(S)/APP(S)THIRD PARTIES PROVIDING SERVICES ON OUR BEHALF</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">We may engage any third parties to perform functions on our behalf, such as hosting or operating our Websites/Applications, sending e-mail communications, and data analysis. We may share Personal Information with third parties in order for them to provide content or otherwise perform services for us, and we will require such parties to maintain appropriate security to protect such data from unauthorized access or processing. It is clarified that in no event shall The Company/ Goodwish9, or any of its directors, employees, or any representatives, be held liable for use of such Personal Information by itself and the aforementioned third parties.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• FOR AFFILIATE SHARING AND BUSINESS TRANSFERS</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">We may share your Personal Information with other entities (Group entities and/ or affiliates) for internal reasons, primarily for business and operational purposes. The Company/ Goodwish 9 or any of its assets, including the Websites/Applications, may be sold, or other transactions may occur in which your Personal Information is one of the business assets of the transaction. In such case, your Personal Information may be transferred. Hence, The Company/ Goodwish9 reserves the right to disclose and transfer user information, including Personal Information in connection with a corporate merger, consolidation, restructuring, the sale of certain of The Company/ Goodwish 9\'s assets, or other corporate change including, without limitation, during the course of any due diligence process</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• POTENTIALINVESTORS</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Certain investors may be interested in investing funds in The Company/ Goodwish9. For the purposes of securing such investment, the Company/ Goodwish9 may be required to disclose data pertaining to your Personal Information or to your Usage Information. We will require such parties to maintain appropriate security to protect such data from unauthorized access or processing. It is clarified that in no event shall The Company/ Goodwish9 be held liable for use of such Personal Information/ Information by itself and the aforementioned third parties.</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">LEGAL PROTECTIONS AND OTHER DISCLOSURES</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• We may transfer and disclose information, including your Personal Information, Usage Information, and Device Identifier (including IP address, Device and/or MAC ID, etc), to third parties: to comply with a legal obligation; when we believe in good faith that the law requires it; at the request of governmental authorities conducting an investigation; to verify or enforce the Websites/Applications’ Terms of Use or other applicable policies; to respond to an emergency; or otherwise to protect the rights, property, safety, or security of third parties, visitors to this Websites/Applications or the public. Pursuant to valid requests by law enforcement agencies, we may also use Device Identifiers to identify users, and may do so in cooperation with copyright owners, internet service providers, wireless service providers or law enforcement agencies, at our discretion. Such disclosures may be carried out without notice to you.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• The Company Might Also Disclose Your Information When The Company Considers Properly Considering That (I) Disclosure Is Needed Through A Seek Warrant, Subpoena (Whether Or Not Criminal Or Civil), Civil Investigative Call For, Court Docket Order, Or A Request For Company Regulation Enforcement Or Other Government Organization; (Ii) Disclosure Is Suitable And Vital To Record A Suspected Crime (Inclusive Of Any Case Of Suspected Toddler Exploitation) Or Prevent Bodily Damage To An Individual Or Belongings, And (ii) Disclosure Is Appropriate And Necessary To Implement Company’s Rights.</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">LINKS TO OTHER WEBSITES/APPLICATIONS AND SERVICES, AND THE COMPANY/ GOODWISH9 CONTENT FOUND ON OTHER WEBSITES/APPLICATIONS</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">i. The Websites/Applications may provide links to other Websites/Applications. This includes links from advertisers, sponsors, and partners that may use our logo(s) as part of a co-branding agreement. Certain content on the Websites/Applications may be hosted and served by third parties, which may include third-party widgets (such as those that allow you to “like” or “share” content with third-party Websites/Applications and interactive services, or third-party “get tickets and showtimes” widgets). The use of these third-party Websites/Applications applications and any information collected, stored, and transferred by them is not subject to this Privacy Policy and is usually governed by their own terms of use and Privacy Policy. By clicking through to these third-party Websites/Applications, you will be governed by such third-party\'s Privacy Policy/ Terms of Use. We have no control over these third parties. These third parties may send their own cookies to your Device, they may independently collect data or solicit Personal Information, and may or may not have their own published privacy policies. The Company/ Goodwish9 is not responsible for the privacy practices or business practices of any third-party Websites/Applications.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">ii. The Company/ Goodwish9 may also display its content/ widgets on third-party Websites/Applications /Application(s). Please note that in such an eventuality, your use of the third-party Websites/Applications/ Application(s) shall continue to be governed by the third-party\'s Privacy Policy/ Terms of Use. We have no control over these third parties. These third parties may send their own cookies to your Device, they may independently collect data or solicit Personal Information, and may or may not have their own published Privacy Policies. The Company/ Goodwish9 is not responsible for the privacy practices or business practices of any third-party Websites/Applications.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iii. The Company’s Website / Applications may offer message boards, chat rooms, alternative reality shows, and other public areas (collectively, “Community Forums”) where you can engage in social networking, interact with others, as well as have the opportunity to submit photographs, writings, music, video, audio recordings, computer graphics, pictures, data, questions, comments, suggestions or other content, including Personal Information (collectively, “User Submissions”).</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iv. To participate in certain Community Forums, you may be asked to select a username, screen name, or member name and password. Furthermore, any such User Submissions that you publish on Company’s Website/Application or submit for publication on the company’s Website/Application may be available, via the internet, around the world, and we cannot prevent the use or misuse of such information by others.</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">PERSONAL INFORMATION YOU DISCLOSE PUBLICLY ON OUR WEBSITES/APPLICATIONS</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">i. Our Websites/Applications may offer message boards, chat rooms, alternative reality shows, and other public areas (collectively, “Community Forums”) where you can engage in social networking, interact with others, as well as have the opportunity to submit photographs, writings, music, video, audio recordings, computer graphics, pictures, data, questions, comments, suggestions or other content, including Personal Information (collectively, “User Submissions”).</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">ii. To participate in certain Community Forums, you may be asked to select a username, screen name, or member name and password. Furthermore, any such User Submissions that you publish on our Websites/Applications or submit for publication on our Websites/Applications may be available, via the internet, around the world, and we cannot prevent the use or misuse of such information by others.</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">NOTE THAT ANYTHING YOU POST TO A COMMUNITY FORUM IS PUBLIC</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">i. Your Submission(s) may be used or shared with any third parties. Information you choose to post or make available in the Community Forums may be viewed, collected, and used by others and we shall have no control over the manner and mode of such use. If you choose to voluntarily disclose User Submissions, the protections of this Privacy Policy will not cover such disclosure of information. Think carefully before you post and use caution before disclosing any Personal Information.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">ii. Also, functionality on the Websites/Applications may permit interactions between the Websites/Applications and third-party Websites/Applications or services, such as enabling you to “like” a product on our Websites/Applications or “share” content to other Websites/Applications or services. If you choose to “like” or “share” content on the Websites/Applications or to otherwise post information from or via the Websites/Applications to a third-party\'s Websites/Applications, service, feature or application, etc. that information will become public and the third party may have access to information about you and your use of our Websites/Applications.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iii. Your Submissions may be published online or offline in any media or format (currently existing or hereafter developed). We may also publish your name, voice, likeness, and other Personal Information with your User Submissions, and the Company/ Goodwish9 may use the content, or any portion of the content, for advertising, marketing, publicity, promotional, or any other activities. For full terms and conditions regarding User Submissions you submit to the Websites/Applications, please refer to our Terms of Use.</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">INFORMATION WE RECEIVE FROM THIRD PARTIES</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">i. The Company/ Goodwish9 may receive information about you from third parties. For example, if you are on another Websites/Applications and you opt-in to receive information from the Company/ Goodwish 9 that Websites/Applications will forward to us your email address and other information about you so that we may contact you as requested. You may also choose to participate in a third-party application or feature on our Websites/Applications (such as logging in through Facebook Connect or otherwise linking the Websites/Applications with other Websites/Applications or interactive services) or on a third-party Websites/Applications or service (such as one of our Facebook applications or a similar application or feature on a third-party Websites/Applications or service) through which you allow us to collect (or the third-party to share) information about you, including Personal Information. When you choose to participate, you may be opting to link your activity on our Websites/Applications with that third-party Websites/Applications or service, which may then collect information about your visits to our Websites/Applications and may publish that activity as you request to your “profile” or similar feature with that third-party (such as if you choose to share content you find on one of our Websites/Applications with your “connections” on the third-party\'s Websites/Applications or service). The information we collect is subject to this Privacy Policy. However, the information collected and stored by the third-party remains subject to the third-party\'s privacy practices, including whether the third-party continues to share information with us or with other third parties, the types of information shared, and your choices with regard to what is visible to others on that third-party\'s Websites/Applications or service.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">ii. The third party may allow you to remove the application or feature, in which case we will no longer collect information about you through the application or feature, but we may retain the information previously collected. In addition, we may receive information about you if other users of a third-party Websites/Applications or service give us access to their profiles and you are one of their “connections” or information about you is otherwise accessible through your “connections” web page, profile page, or similar page on a social networking or other third-party Websites/Applications or interactive service.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iii. We may also supplement the information we collect about you through the Websites/Applications with outside records from third parties in order to enhance our ability to serve you, tailor our content to you, and offer you opportunities to purchase products or services that we believe may be of interest to you. We may combine the information we receive from these third parties with information we collect through the Websites/Applications. In those cases, we will apply this Privacy Policy to any Personal Information received, unless we have disclosed otherwise.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iv. The Company shall not disclose or provide your Personal Information to third parties unless:</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• You have given your consent;</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• Personal data with subcontractors (and their subcontractors) that we engage to process all or part of the personal data to the extent necessary to achieve the purpose of using the personal data;</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• Personal information is provided to the persons listed above in the section \"Personal information is shared with them\";</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• Disclosure or availability is required by law of this land;</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• The disclosure or provision is necessary to protect someone\'s life, body or property, but obtaining your consent is difficult;</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• It is necessary to cooperate with the central or local authorities, which may interfere with the performance of their state administrative duties and obtaining their consent.</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; margin: 0em; font-weight: 400;\"><div style=\"text-align: left;\"><span style=\"font-size: 3.157em; background-color: rgb(255, 255, 255);\">WE MAY USE AD SERVING AND TRAFFIC MEASUREMENT SERVICES;</span></div><div style=\"text-align: left;\"><span style=\"font-size: 3.157em; background-color: rgb(255, 255, 255);\">HOW TO “OPT-OUT” OF RECEIVING ADVERTISING RELEVANT TO YOU</span></div></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">i. The Company/ Goodwish9 licenses technology to serve advertisements on its own Websites/Applications and within its videos and other content as that content is served across the internet. In addition, The Company/ Goodwish 9 may use third party network advertisers to serve advertisements and third-party analytics service providers to evaluate and provide us with information about the use of the Websites/Applications and viewing of our content. We do not share Personal Information with these third parties, but ad network providers, advertisers, sponsors, and/or analytics service providers may set and access their own cookies, web beacons, and embedded scripts on your Device, and they may otherwise collect or have access to information about you, including Usage Information.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">ii. With regard to advertisements, we and our network advertisers may target advertisements for products and services in which you might be interested based on your visits to both the Websites/Applications and other Websites/Applications. Cookies and web beacons, including those set by third-party network advertisers, may be used to, among other things, target advertisements, prevent you from seeing the same advertisements too many times, or conduct research regarding the usefulness of certain advertisements to you. We may share Usage Information about visitors to the Websites/Applications with third-party advertising companies for the same purposes. We may use a variety of companies to serve advertisements</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">SECURITY</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">i. We incorporate commercially reasonable safeguards to help protect and secure your Personal Information. However, no electronic data transmissions or storage of information can be guaranteed to be 100% secure. You acknowledge that we cannot ensure or warrant the security of any information you transmit to us, and you use the Websites/Applications and provide us with your information at your own risk.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">ii. The Company possesses the appropriate security measures to protect against the loss, misuse, and unauthorized alteration of the information under the Company’s control. However, the Company is not responsible for any kind of disruptions or occurrence of unauthorized access.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iii. You are solely accountable for (a) keeping your account(s) secure and (b) for all activity that takes place under your account (s). If you suspect any unauthorized access to or use of your account, you must contact us right away (s). If you\'ve forgotten your account login details, you can ask us to send them to the email address linked to your account (s).</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">PERSONAL INFORMATION WEBSITES/APPLICATIONS AMENDING OR REMOVING YOUR PERSONAL INFORMATION, CONTROLLING MARKETING COMMUNICATIONS, AND PRIVACY QUESTIONS</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em; text-align: justify;\"></p><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">i. You have the right to access your Personal Information held by us and, if necessary, have it amended or deleted. You can also request not to receive an email, SMS, and MMS marketing communications from us. You may opt-out of receiving email newsletters and other marketing communications by following the opt-out instructions provided to you in those emails. If you sign up to receive SMS or MMS messages, you may unsubscribe from any SMS or MMS messages received by replying “STOP.” Please note that we may still need to send you certain communications relating to your account or use of the Websites/Applications and these transactional account messages may be unaffected if you choose to opt-out from marketing communications.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">ii. For more details or any privacy questions please contact us by email at info@vedangweb.com (name and contact no of the Grievance office not mentioned. Who ) or write to us at: Legal Department</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">The Company B 501 Annpurna New Link Road,Andheri (W), Mumbai 400053</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">iii. We request you to please provide the following information in your complaint:-</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• a. Identification of the information provided by you</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• b. Clear statement as to whether the information is Personal Information or Sensitive Personal Information</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• c. Your address, telephone number, or email address.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• d. A statement that you have a good-faith belief that the information has been processed incorrectly or disclosed without authorization, as the case may be.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">• e. A statement, under penalty of perjury, that the information in the notice is accurate, and that the information being complained about belongs to you.</span></div><div style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">You may also contact us in case you have any questions/suggestions about the Privacy Policy using the contact information mentioned above.</span></div><p></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">NOTIFICATION OF CHANGES AND YOUR ACCEPTANCE OF THE PRIVACY POLICY</span></h2><div style=\"text-align: left;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></font></div><p class=\"iq-title-desc\" style=\"text-align: left; font-family: Roboto, sans-serif; font-size: 16px; margin: 0.625em 0px 0px; line-height: 1.66em;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">We reserve the right to change the terms of this Privacy Policy at any time, without notice, by prominently posting notice of the amendment on this Website/Applications. To the extent permitted by applicable law, such changes will be applicable from the time they are posted. The Company/ Goodwish9 will use your Personal Information in a manner consistent with the Privacy Policy in effect at the time you submitted the information.</span></p></div></div></div><div class=\"row\" style=\"margin-right: -1em; margin-left: -1em;\"><div class=\"col-lg-12 col-sm-12 mb-sm-4\" style=\"width: 1170px; padding-right: 1em; padding-left: 1em;\"><div class=\"text-center iq-title-box iq-title-default\" style=\"padding: 0.625em;\"><h2 class=\"iq-title text-capitalize\" style=\"font-family: Roboto, sans-serif; font-size: 3.157em; text-align: left; margin: 0em; font-weight: 400;\"><span style=\"background-color: rgb(255, 255, 255);\">COMPLIANCE WITH LAWS AND LAW ENFORCEMENT</span></h2><div style=\"text-align: left;